import React from 'react';
import styles from './jamming.module.css';

const clientId = '367a1dd9d8fa4e7aac443fb3cd47e9fd'; // Replace with your Client ID
const redirectUri = 'http://localhost:3000/callback'; // Replace with your Redirect URI
const scopes = [
  'user-read-private', 
  'user-read-email' // Add other scopes as needed
].join(' ');

// Build the authorization URL
const authUrl = `https://accounts.spotify.com/authorize?response_type=code&client_id=${clientId}&scope=${encodeURIComponent(scopes)}&redirect_uri=${encodeURIComponent(redirectUri)}`;

// Redirect the user
window.location.href = authUrl;

const fetchTokens = async (authorizationCode) => {
  const clientId = 'your-client-id'; // Replace with your Client ID
  const clientSecret = 'your-client-secret'; // Replace with your Client Secret
  const tokenUrl = 'https://accounts.spotify.com/api/token';

  const response = await fetch(tokenUrl, {
    method: 'POST',
    headers: {
      'Content-Type': 'application/x-www-form-urlencoded',
      'Authorization': 'Basic ' + btoa(clientId + ':' + clientSecret),
    },
    body: new URLSearchParams({
      grant_type: 'authorization_code',
      code: authorizationCode,
      redirect_uri: 'http://localhost:3000/callback', // Replace with your Redirect URI
    }),
  });

  if (!response.ok) {
    throw new Error('Failed to fetch tokens');
  }

  const data = await response.json();
  return {
    accessToken: data.access_token,
    refreshToken: data.refresh_token,
    expiresIn: data.expires_in, // Expiry time in seconds
  };
};




